angular.module("HousePointsApp").run(["$templateCache",function(e){e.put("login/login.html",'<section class="login-section">\r\n    <form class="form login-form" id="loginform" name="loginform" novalidate ng-submit="loginVm.submit(loginform.$valid, loginVm.user)">\r\n        <h2>Login</h2>\r\n        <fieldset>\r\n            <div class="field">\r\n                <input type="email" id="email" name="email" placeholder="Email" required maxlength="50" ng-model="loginVm.user.email"/>\r\n                <span class="error-message" ng-if="loginform.$submitted && loginform.email.$invalid">Please enter a valid email address.</span>\r\n            </div>\r\n            <div class="field">\r\n                <input type="password" id="password" name="password" placeholder="Password" required maxlength="50" ng-model="loginVm.user.password"/>\r\n                <span class="error-message" ng-if="loginform.$submitted && loginform.password.$error.required">Please enter a password.</span>\r\n            </div>\r\n            <input type="submit" class="button"/>\r\n        </fieldset>\r\n    </form>\r\n</section>'),e.put("main/main.html","<div>{{ mainVm.message }}</div>")}]);